#define MAX_NODES 110
#define INFINITY 100000000
int n=MAX_NODES;
int path[MAX_NODES];
//int arr[4]={1,2,3,2};
int tot=0;
typedef enum{permanent,tentative} node_label;
struct state
   {
      int predecessor;
      int length;
      node_label label;
   }state[MAX_NODES];

void shortest_path(char dist[][MAX_NODES],int s,int t)
{

   int i,k,min;
   struct state *p;
   for(p=&state[0];p<&state[n];p++)
   {
   	p->predecessor=-1;
      p->length=INFINITY;
      p->label=tentative;
   }
   state[t].length=0;
   state[t].label=permanent;
   k=t;
   do
   {
   	for(i=0;i<n;i++)
      {
      	if(dist[k][i]!=0&&state[i].label==tentative)
         {
         	if(state[k].length+dist[k][i]<state[i].length)
            {
            	state[i].predecessor=k;
               state[i].length=state[k].length+dist[k][i];
            }
         }
      }
      k=0;min=INFINITY;
      for(i=0;i<n;i++)
      {
      	if(state[i].label==tentative&&state[i].length<min)
         {
         	min=state[i].length;
            k=i;
         }
      }
      state[k].label=permanent;
   }while(k!=s);
   i=0;k=s;
   do{
   path[i++]=k;
   k=state[k].predecessor;
   }while(k!=t);
   path[i++]=t;
	tot=i;
}
